import React from 'react'

export default function Logout(props) {
    const handelLogout = () => {
        localStorage.
        window.location.href = '/'
    }
  return (
    <>
     <div className="modal">
        <div className="modal-content">
            <h2>Are you sure you want to log out ???</h2>
            <div className="btn-1">
                <button className="btn-2" onClick={handelLogout}>Log Out</button>
                <button className="btn-3" onClick={() => props.setShowLogo(false)}>Cancle</button>
            </div>
        </div>
     </div>
    </>
  )
}
